import React from 'react';
import { ApiService }  from '../../services/ApiService';
export default class SearchBar extends React.Component {

  render() {
    return (
    <ul>
     { this.props.repos.map(repos => 
     <li>
       <h1> Repository name: {repos.name} </h1>
       <span> Language: {repos.language || '-'} </span>
       <span> Created at: {repos.creationDate} </span>
       <span> Last Update: {repos.lastUpdate} </span>

       <p> Description: {repos.description || '-'} </p>
      </li>) 
     }
    </ul>
    );
  }
}
